import React from 'react';
import {Spotify} from './components/Spotify'
import {Card} from './components/Card'
import './App.css';

function App() {
  return (
    <div className="webapp">
      <div className="todo-container">
        <Card />
      </div>

      <div className='other-container'>
        <Spotify />
      </div>
    </div>
  );
}


export default App;
